export default (function(a,b,c,d,e,f,g,h,i,j,k,l,m){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:g,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:a,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:a,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:a,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:g,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:h,pageSize:25,pageCount:h,total:5}}},"8OdHymPzW7":{data:{id:938,attributes:{imdbId:"tt0879870",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMTY5NDkyNzkyM15BMl5BanBnXkFtZTcwNDQyNDk0Mw@@._V1_SX300.jpg",type:a,ratings:[{Source:"Internet Movie Database",Value:"5.8\u002F10"},{Source:"Rotten Tomatoes",Value:"36%"},{Source:"Metacritic",Value:"50\u002F100"}],item_lang:{data:{id:1601,attributes:{title:i,plot:"Liz Gilbert (Roberts) had everything a modern woman is supposed to dream of having - a husband, a house, a successful career - yet like so many others, she found herself lost, confused, and searching for what she really wanted in life. Newly divorced and at a crossroads, Gilbert steps out of her comfort zone, risking everything to change her life, embarking on a journey around the world that becomes a quest for self-discovery. In her travels, she discovers the true pleasure of nourishment by eating in Italy; the power of prayer in India, and, finally and unexpectedly, the inner peace and balance of true love in Bali.",slug:"eat-pray-love"}}},books:{data:[{id:5585,attributes:{title:"Eat, Pray, Love",description:"The Number One international bestseller, Eat, Pray Love is a journey around the world, a quest for spiritual enlightenment and a story for anyone who has battled with divorce, depression and heartbreak.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=QdCNeNx6LJUC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:true,published:"2007-03-05",publisher:"A&C Black",subtitle:"One Woman's Search for Everything"}},{id:5586,attributes:{title:i,description:"One of the most iconic, beloved, and bestselling books of our time. This beautifully written, heartfelt memoir touched a nerve among both readers and reviewers. Elizabeth Gilbert tells how she made the difficult choice to leave behind all the trappings of modern American success (marriage, house in the country, career) and find, instead, what she truly wanted from life. Setting out for a year to study three different aspects of her nature amid three different cultures, Gilbert explored the art of pleasure in Italy and the art of devotion in India, and then a balance between the two on the Indonesian island of Bali. By turns rapturous and rueful, this wise and funny author (whom Booklist calls “Anne Lamott’s hip, yoga- practicing, footloose younger sister”) is poised to garner yet more adoring fans.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=DBTe69TMdmMC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:c,published:"2006-02-16",publisher:d,subtitle:e}},{id:5587,attributes:{title:"Eat Pray Love Epz Film Export",description:f,thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=8Y3MmgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:["Gilbert Elizabeth"],firstBook:c,published:"2013-01-01",publisher:f,subtitle:f}},{id:5588,attributes:{title:j,description:k,thumbnail:l,authors:[b],firstBook:c,published:m,publisher:d,subtitle:e}},{id:5589,attributes:{title:j,description:k,thumbnail:l,authors:[b],firstBook:c,published:m,publisher:d,subtitle:e}}]}}},meta:{}}},prerenderedAt:1681309480696}}("movie","Elizabeth Gilbert",null,"Penguin","One Woman's Search for Everything Across Italy, India and Indonesia","","series",1,"Eat Pray Love","Eat Pray Love 10th-Anniversary Edition","The 10th anniversary edition of one of the most iconic, beloved, and bestselling books of our time from the bestselling author of City of Girls and Big Magic, Elizabeth Gilbert. Elizabeth Gilbert’s Eat Pray Love touched the world and changed countless lives, inspiring and empowering millions of readers to search for their own best selves. Now, this beloved and iconic book returns in a beautiful 10th anniversary edition, complete with an updated introduction from the author, to launch a whole new generation of fans. In her early thirties, Elizabeth Gilbert had everything a modern American woman was supposed to want—husband, country home, successful career—but instead of feeling happy and fulfilled, she was consumed by panic and confusion. This wise and rapturous book is the story of how she left behind all these outward marks of success, and set out to explore three different aspects of her nature, against the backdrop of three different cultures: pleasure in Italy, devotion in India, and on the Indonesian island of Bali, a balance between worldly enjoyment and divine transcendence.","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=EbquUB1D6B8C&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","2007-01-30"))